import React, { Component } from "react";

import "./style.css";

export default class Menubar extends Component {
  constructor(props) {
    super(props);
    this.state = { isOpen: false };
  }

  isOpen = () => {};
  clickHandler = () => {
    this.setState({ isOpen: true });
  };
  render() {
    return (
      <div className="App">
        <div onClick={this.clickHandler}>
          <div className="burger-menu"></div>
          <div className="burger-menu"></div>
          <div className="burger-menu"></div>
        </div>
      </div>
    );
  }
}
